-- CST438__car_reservation_3_Schema
--
-- Schema is quite simple just two tables one for cars that is populated upon creation and a reservations table with the foreign key car_id
-- reservations table has date fields "date_start" and "date_end" to keep track of which cars are not avialable on which dates. 
-- the query "SELECT * FROM reservations WHERE (:date_start <= date_end) and (:date_end >= date_start) AND car_id = :id" is used to get a list 
-- of all cars that are reserved in  between those dates. The total number of results then gets compared against the car table's 'quantity'
-- if the number of reservations for that date range is more then that car gets skipped from the list
--
-- ------------------------------------------------------- Schema 'me6kufjcw0jo8ccm'-------------------------------------------------------- 
DROP SCHEMA IF EXISTS `me6kufjcw0jo8ccm`;
CREATE SCHEMA IF NOT EXISTS `me6kufjcw0jo8ccm` DEFAULT CHARACTER SET utf8 ;USE `me6kufjcw0jo8ccm` ;
-- ------------------------------------------------------------------------------------------------------------------------------------------------------

-- ------------------------------------------------------- Table `me6kufjcw0jo8ccm`.`car`-- -----------------------------------------------------
DROP TABLE IF EXISTS me6kufjcw0jo8ccm.car;
CREATE TABLE IF NOT EXISTS me6kufjcw0jo8ccm.car(
   id           INTEGER  NOT NULL PRIMARY KEY 
  ,model        VARCHAR(35) NOT NULL
  ,make         VARCHAR(10) NOT NULL
  ,year         INTEGER  NOT NULL
  ,trany        VARCHAR(9) NOT NULL
  ,citympg      NUMERIC(6,2) NOT NULL
  ,highwaympg   NUMERIC(6,2) NOT NULL
  ,car_class    VARCHAR(12) NOT NULL
  ,fuel_type    VARCHAR(27) NOT NULL
  ,rental_price INTEGER  NOT NULL
  ,state        VARCHAR(2) NOT NULL
  ,city         VARCHAR(12) NOT NULL
  ,quantity     INTEGER  NOT NULL
  ,image        VARCHAR(12) NOT NULL
);
-- -----------------------------------------------------------------------------------------------------------------------------------------------

-- ------------------------------------------------------- Table `me6kufjcw0jo8ccm`.`reservations`----------------------------------------------
DROP TABLE IF EXISTS me6kufjcw0jo8ccm.reservations;
CREATE TABLE IF NOT EXISTS me6kufjcw0jo8ccm.reservations(
   id         INTEGER  NOT NULL PRIMARY KEY 
  ,car_id     INTEGER  NOT NULL
  ,email      VARCHAR(28) NOT NULL
  ,date_start VARCHAR(10) NOT NULL
  ,date_end   VARCHAR(10) NOT NULL
);

ALTER TABLE `me6kufjcw0jo8ccm`.`reservations` 
ADD CONSTRAINT `fk_car_id`
  FOREIGN KEY (`car_id`)
  REFERENCES `of5ifv1xktyptynm`.`car` (`id`)
  ON DELETE NO ACTION
  ON UPDATE NO ACTION;
-- ---------------------------------------------------------------------------------------------------------------------------------------------------

